import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";

const IndiaCluster = () => {
    const [myIndiaData, setIndiaClusterData] = useState([])

    useEffect(() => {
        axios.get('./india/india-cluster.json')
          .then((res) => {
            setIndiaClusterData(res.data)
            console.log(res.data)
          }
        )
    }, [])

    return (
        <>
            <div className="cluster">
                <h4>{myIndiaData}</h4>
            </div>
        </>
    )
}

export default IndiaCluster
